const nombre = "Rimuru";
const apellido = "Tempest";

let edad = 2;

console.log(`Hola soy ${nombre} ${apellido} y tengo ${edad} años`);

if (true) {
  const nombre = "True Dragon";
  console.log(nombre);
}

console.log(nombre);
